  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset has been developed for the
  National Oceanic and Atmospheric Administration's (NOAA) Office for Coastal Management
  (OCM) as a collaborative and cooperative project with the California State Coastal
  Conservancy (SCC) on behalf of the Ocean Protection Council (OPC) to collect and
  delineate habitat data in the San Francisco Bay area. Data is intended for use in
  coastal management decision making, including applications such as sea level rise.
  The mission of the Center is to support the environmental, social, and economic
  well-being of the coast by linking people, information, and technology.\",\n\t\"license_title\":
